INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'<h2 class=\"rtecenter\"><strong>2018 NCI Outstanding Mentor Award</strong></h2>\r\n\r\n<h3 class=\"rtecenter\">Call for Nominations</h3>\r\n\r\n<p>This year marks the 18th anniversary of the Outstanding Mentor Award, which recognizes NCI scientists for excellence in mentoring and guiding the careers of trainees in cancer research. All winners will be recognized at the annual NCI Award Ceremony this fall.</p>\r\n\r\n<p>Current NCI scientists who serve as mentors may be nominated with the exception of those who have received the award within the last five years. See complete list of previous winners on website.</p>\r\n\r\n<p>Eligible categories include, but are not limited to: investigators, staff scientists, staff clinicians, contractor scientists, or any scientist in a role to mentor NCI fellows.&nbsp; Staff in all NCI Divisions (intramural and extramural) is eligible.&nbsp; If you are not certain whether or not someone is eligible, please contact Angela Jones in Center for Cancer Training at&nbsp;<u><a href=\"https://mynci.cancer.gov/topics/ncimentorawards@mail.nih.gov\">ncimentorawards@mail.nih.gov</a></u>.</p>\r\n\r\n<p>If you are a&nbsp;<strong>current postdoctoral fellow</strong>,&nbsp;<strong>research fellow</strong>, or&nbsp;<strong>clinical fellow</strong>&nbsp;use this opportunity to nominate your outstanding mentor. The deadline for nominations is&nbsp;<strong>Friday,&nbsp;July 20, 2018.</strong></p>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page',0,2,2,'und',0,'<h2 class=\"rtecenter\"><strong>Instructions</strong></h2>\r\n\r\n<h3><strong>Eligibility</strong></h3>\r\n\r\n<p>Current NCI scientists who serve as mentors may be nominated,&nbsp;<strong>with the exception of those who have received the award within the last five years.&nbsp;&nbsp;</strong>Please review the list of previous winners to confirm eligibility before submitting your nomination. &nbsp;</p>\r\n\r\n<p>Eligible categories include investigators, staff scientists, staff clinicians, contractor scientists, or any NCI scientist in the role to mentor NCI fellows.&nbsp; Staff in all NCI Divisions (intramural and extramural) are eligible.&nbsp; If you are not certain if someone is eligible, please e-mail Angela Jones at &nbsp;<u><a href=\"mailto:ncimentorawards@mail.nih.gov\">ncimentorawards@mail.nih.gov</a></u>.</p>\r\n\r\n<h3><strong>Review Criteria</strong></h3>\r\n\r\n<p>To evaluate each nomination, the review committee will consider seven separate criteria which address the quality of the nominee’s mentoring: mentoring record, professional expertise, accessibility, communication, training environment, provision of visibility for trainees, and commitment to trainee career development.&nbsp;</p>\r\n\r\n<h3><strong>Procedure</strong></h3>\r\n\r\n<ul>\r\n	<li>Download <a href=\"#\">nomination form</a> and <a href=\"\">optional signature page</a>.</li>\r\n	<li><strong>Each nominee must have ONE primary <em>and</em> ONE secondary nomination</strong>. The primary nominator is responsible for enlisting a secondary nominator.&nbsp; Incomplete nominations will not be reviewed and extra nominations will not be reviewed.&nbsp;</li>\r\n	<li>The <em>Primary</em> nominator must be a current postdoctoral fellow, research fellow, or clinical fellow (or recent fellow, i.e., departed NIH within the last 12 months).</li>\r\n	<li>The <strong>Secondary<strong> nominator may be a current or former fellow or student, or other trainee with appropriate knowledge of the nominee.</strong></strong></li>\r\n	<li><strong><strong><strong>Each</strong> nominator should write a narrative to address each of the criteria. One nomination form is required for each nomination. Please include both primary and secondary nominators’ narrative. </strong></strong></li>\r\n	<li><strong><strong>Optional: You may provide name, position, e-mail, and signature of any additional supporters by using the signature page. Submit the signature page (s) with the nomination package.</strong></strong></li>\r\n	<li><strong><strong>Save the document and upload as: <u>NomineeLastName.2018 OMA</u> (e.g., Jones.2018OMA) – where Jones refers to the mentor being nominated. PDF files required.</strong></strong></li>\r\n</ul>\r\n\r\n<p><strong><strong><strong>Completed nominations must be submitted&nbsp;no later than Friday, July 20, 2018.</strong></strong></strong></p>\r\n\r\n','','full_html');
