INSERT INTO `search_dataset` VALUES (1,'node',' overview 2018 nci outstanding mentor award call for nominations this year marks the 18th anniversary of the outstanding mentor award which recognizes nci scientists for excellence in mentoring and guiding the careers of trainees in cancer research all winners will be recognized at the annual nci award ceremony this fall current nci scientists who serve as mentors may be nominated with the exception of those who have received the award within the last five years see complete list of previous winners on website eligible categories include but are not limited to investigators staff scientists staff clinicians contractor scientists or any scientist in a role to mentor nci fellows staff in all nci divisions intramural and extramural is eligible if you are not certain whether or not someone is eligible please contact angela jones in center for cancer training at  ncimentorawards mailnihgov  if you are a  current postdoctoral fellow   research fellow  or  clinical fellow  use this opportunity to nominate your outstanding mentor the deadline for nominations is  friday july 20 2018 ',0);
INSERT INTO `search_dataset` VALUES (2,'node',' instructions instructions eligibility current nci scientists who serve as mentors may be nominated  with the exception of those who have received the award within the last five years  please review the list of previous winners to confirm eligibility before submitting your nomination eligible categories include investigators staff scientists staff clinicians contractor scientists or any nci scientist in the role to mentor nci fellows staff in all nci divisions intramural and extramural are eligible if you are not certain if someone is eligible please email angela jones at  ncimentorawards mailnihgov  review criteria to evaluate each nomination the review committee will consider seven separate criteria which address the quality of the nominee s mentoring mentoring record professional expertise accessibility communication training environment provision of visibility for trainees and commitment to trainee career development  procedure download nomination form and optional signature page  each nominee must have one primary and one secondary nomination  the primary nominator is responsible for enlisting a secondary nominator incomplete nominations will not be reviewed and extra nominations will not be reviewed the primary nominator must be a current postdoctoral fellow research fellow or clinical fellow or recent fellow ie departed nih within the last 12 months the secondary nominator may be a current or former fellow or student or other trainee with appropriate knowledge of the nominee each nominator should write a narrative to address each of the criteria one nomination form is required for each nomination please include both primary and secondary nominators narrative optional you may provide name position email and signature of any additional supporters by using the signature page submit the signature page s with the nomination package save the document and upload as  nomineelastname2018 oma  eg jones2018oma where jones refers to the mentor being nominated pdf files required completed nominations must be submitted no later than friday july 20 2018 ',0);
